    render(){
        return(
            <div>
                <h1>Creating Class</h1>
                <ul>
                    <li>import component then use extends and component</li>
                    <li>render then return</li>
                </ul>
                <p>import component then use extends and component</p>
                <p> </p>
            </div>
        )
    }
    
}

export default Newclass1;
